package SeleniumClass;
/*
 * 2. WAP to print following output:
I am Batman 1
I am Batman 2
I am Batman 3
I am Batman 4
I am Batman 5
I am Batman 6
I am Batman 7
I am Batman 8
I am Batman 9
 */
public class Assignment2WhileLoop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    int i=1;
    while(i<10) {
    	System.out.println("I am Batman"+" "+i);
    	i++;
    }
	}

}
